import React, { useState } from 'react';
import axios from 'axios';
import './Auth.css';

const Register = () => {
    const [formData, setFormData] = useState({
        email: '',
        password: '',
        ownerName: '',
        shopName: '',
        shopLocation: '',
        shopCategory: '',
    });

    const onChange = (e) => setFormData({ ...formData, [e.target.name]: e.target.value });

    const onSubmit = async (e) => {
        e.preventDefault();
        try {
            const res = await axios.post('/api/auth/register', formData);
            localStorage.setItem('token', res.data.token);
            alert('Registration successful');
        } catch (err) {
            console.error(err.response.data);
        }
    };

    return (
        <div className="auth-container">
            <h2>Register</h2>
            <form onSubmit={onSubmit} className="auth-form">
                <input type="email" name="email" onChange={onChange} placeholder="Email" required />
                <input type="password" name="password" onChange={onChange} placeholder="Password" required />
                <input type="text" name="ownerName" onChange={onChange} placeholder="Owner Name" required />
                <input type="text" name="shopName" onChange={onChange} placeholder="Shop Name" required />
                <input type="text" name="shopLocation" onChange={onChange} placeholder="Shop Location" required />
                <select name="shopCategory" onChange={onChange} required>
                    <option value="" disabled>Select Shop Category</option>
                    <option value="grocery">Grocery</option>
                    <option value="clothing">Clothing</option>
                    <option value="electronics">Electronics</option>
                    <option value="pharmacy">Pharmacy</option>
                    <option value="restaurant">Restaurant</option>
                </select>
                <button type="submit">Register</button>
            </form>
        </div>
    );
};

export default Register;
